	public void setShakeMapURL(String shakeMapURL) {
		this.shakeMapURL = shakeMapURL;
	}

	private static double unwrap(double lon){
		if (lon > 180)
			lon -= 360;
		return lon;
	}
	
	public static void main(String[] args){
		GraphicalForecast gf = new GraphicalForecast();
		gf.processForecastStrings();
		gf.assignForecastStrings();
		gf.setShakeMapURL("https://earthquake.usgs.gov/archive/product/shakemap/atlas20100404224043/atlas/1520888708106/download/intensity.jpg");
		try{
			gf.writeHTML(new File(System.getenv("HOME") + "/example_forecast.html"));
		}catch(Exception e){
			e.printStackTrace();
		}
		
		String pngFile = "resources/USAID-Logo.png";
		URL logoURL = GraphicalForecast.class.getResource(pngFile);
		if (logoURL != null){
			File logoFile = new File(logoURL.getFile());
			File destination = new File(System.getenv("HOME") + "/" + pngFile);

			try {
				FileUtils.copyFile(logoFile, destination);
			} catch (IOException e) {
							    e.printStackTrace();
				System.err.println("Couldn't copy: " + logoFile + " to file: " + destination);
			}
		} else {
			System.err.println("Couldn't locate file: " + pngFile);
		}

	}

